 including Yosemite National Park, Carlsbad Caverns National Park and Dinosaur National Monument, the park service said in a statement Saturday. \r\n \r\n“Tom Lorig served Bryce Canyon, the National Park Service, and the public as an interpretive park ranger, forging connections between the world and these special places that he loved,” Bryce Canyon Superintendent Jim Ireland said in the statement.', 'User', 'User', '2024-07-06 21:54:43')
